import styled from "styled-components";

export const PostList = styled.section`
  width: 100%;
  max-width: 580px;
  margin: 0 auto;
  padding: 0 30px;
`;

export const UserInfo = styled.div``;

export const UserLabel = styled.span``;

export const Icon = styled.img``;

export const Actions = styled.div``;
